column8:
製品特徴
<br>
RGのHID純正交換バルブは、D2S/D2R(D4S/D4R)共用の口金（フランジ）を採用し、着脱式の遮光板（シェード）を併用することにより、高い汎用性とそれぞれ理想的な配光を実現しました。<br>
また、３年間の保証付き、耐久性に自信があるからこその証明です。<br>
D2R(D4R)にご使用の際は、シェードを装着し、D2S(D4S)にご使用の際はシェードを外してください。
<BR>
※シェードの取扱いを誤ると配光のずれや減光などが起こり、車検に対応出来ないケースが出てきます。
<BR>

<br>
※12:必ず弊社HID車種別適用表をご確認の上ご装着下さい。<BR>
ヘッドランプに2800KイエローHIDを装着する場合、<BR>
平成18年1月以降の新車登録車両は車検非対応です。<BR>
また、10000Kは競技車専用品であり、車検非対応となります（保安基準より）。<BR>
※13:当社保証規定に基づき、ご購入より3年間の製品について保証します。<BR>

<BR>
【D4バルブは水銀フリーを保証します】<BR>

発熱量を減少させ、点灯初期の放電性を高めるための特殊加工を施しています。<BR>
<BR>
１・インナーガラスとアウターガラスの間を真空にし、内部に特殊冷却ガスを注入しています。<BR>
<BR>
２・導電性の高い白金フィルムを1次側電極部に被せ、初期導電性を大幅にアップさせています。<BR>

